import axios from "axios"

export const createClient = (data) => {
    const response = axios.post("http://localhost:8080/api/member" , data);

    return response;
}

export const createDesigner = (data) => {
    const response = axios.post("http://localhost:8080/api/designer" , data);

    return response;
}

export const getClients = async () =>{
    const response = await axios.get("http://localhost:8080/api/member/login");

    return response.data;
}

export const getDesigners = async () =>{
    const response = await axios.get("http://localhost:8080/api/designer/login");

    return response.data;
}
